// taken from https://sepolia.etherscan.io/tx/0x6adc552b3262bc7b48d9d6f7e4b1980267d06a6775bf69558b9bff667743e087
// during testing this batch came out with 11 blocks but should have only had 3
func Test_Integration_L1DataForBatch33(t *testing.T) {
	testData := ""

	txData := common.FromHex(testData)

	batches, _, _, err := DecodeL1BatchData(txData, "")
	if err != nil {
		t.Fatal(err)
	}
	if len(batches) != 1 {
		t.Errorf("expected 4 transactions but found %v", len(batches))
	}

	// now decode the batch and check the blocks
	blocks, err := zktx.DecodeBatchL2Blocks(batches[0], 9)
	if err != nil {
		t.Fatal(err)
	}

	if len(blocks) != 3 {
		t.Errorf("expected 3 blocks but found %v", len(blocks))
	}
}
